INSERT INTO `gh_information` (`id`, `title`, `content`, `create_time`, `update_time`, `author`, `sort`, `status`, `readnum`) VALUES
	(22, '你好高捷', '<p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">【观察者网综合】在“过境”美国休斯敦时，得克萨斯州州长阿博特送给与蔡英文一个时钟引爆了台湾社交网络。不过，蔡英文所遭受的“礼遇”似乎远未结束。蔡英文到访洪都拉斯，下榻饭店一张“中国台湾省”的账单，被台媒视为“矮化国格”。</p><p class="detailPic" style="margin: 0px auto 10px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: center; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><img src="http://p2.ifengimg.com/a/2017_02/0c0fbc9ff777f2a_size20_w456_h451.jpg" alt="" style="border: 0px; vertical-align: bottom; display: block; margin: 0px auto; max-width: 100%; height: auto;" width="456" height="451"/></p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">据“中央社”1月10日报道，蔡英文7日到15日出访中美洲四国，9日飞抵洪都拉斯。</p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">抵达洪都拉斯后，蔡英文下榻当地的宏京皇家洲际饭店，有台湾随行采访记者发现，饭店的签账单上，写的是中国台湾省(Taiwan, Province of China)。</p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">台媒称，这种做法疑似“矮化国格”。</p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">事后，饭店发声明指出，因为帐单系统的错误以及人为疏失，对于造成访团的不便，深表歉意。之后饭店将账单改成“Taiwan, Republic”。</p><p><br/></p>', '2017-01-06 11:32:02', '2017-01-10 06:47:07', '你好高捷', 100, 0, 22),
	(23, '没有标题', '<p><img src="http://120.76.188.210/goldjet/public/uploads/ueditor/image/20170109/1483925813247336.png" title="1483925813247336.png" alt="{SH_2~BPJ(Y[7[PZOFA2KIM.png"/>&nbsp;&nbsp; <br/></p><p><img src="http://120.76.188.210/goldjet/public/uploads/ueditor/image/20170125/1485335486889020.png" title="1485335486889020.png" alt="QQ图片20170125170936.png"/></p><p>&nbsp; &nbsp; 锄禾日当午，医生真辛苦，拿着小破针，一扎一上午！</p>', '2017-01-09 09:36:58', '2017-01-25 17:11:30', '木有', 100, 0, 27),
	(24, '我的公告', '我的公告我的公告我的公告我的公告我的公告我的公告我的公告我的公告<img src="http://120.76.188.210/goldjet/public/uploads/ueditor/image/20170109/1483954320154538.jpg" title="1483954320154538.jpg" alt="Jellyfish.jpg"/>', '2017-01-09 05:32:08', NULL, '公告作者', 2, 0, 22),
	(25, '明天起冷空气来袭', '<p><strong>天气实况：</strong></p><p><br/></p><p>　　</p><p>10日早晨珠江三角洲、粤东、粤西北部和粤北西部市县阴天，其余市县多云到晴天有轻雾；粤北大部市县和珠江三角洲北部山区市县最低气温10～13℃，粤西南部市县18℃～20℃，其余市县14～17℃。</p><p><br/></p><p>　　</p><p style="text-align:center;"><br/></p><p><img alt="明天起冷空气来袭 我省将迎连续性寒冷阴雨天气" src="/goldjet/public/uploads/ueditor/image/20170110/1484039573249108.jpg"/></p><p><br/></p><p>　　</p><p><strong>未来几天天气预报：</strong></p><p><br/></p><p>　　</p><p>预计，11日到15日，受持续补充入粤冷空气影响，全省气温逐日下降，中北部市县转连续性寒冷阴雨天气，南部市县也有分散小雨，气温日较差小，日平均气温偏低。具体预报如下：</p><p><br/></p><p>　　</p><p>10日，清远和韶关市县阴天，其余市县多云，早晚有轻雾，气温小幅上升。</p><p><br/></p><p>　　</p><p>11到12日，清远、韶关、肇庆、云浮阴天有小雨局部中雨，其余市县多云到阴天有轻雾，局部有小雨。全省气温下降2～4℃。韶关、清远和河源北部市县最低气温8℃～11℃，茂名、湛江16～20℃，其余市县12℃～16℃。</p><p><br/></p><p>　　</p><p>13到14日，清远、韶关、肇庆阴天有小雨，部分市县有中雨，其余市县多云到阴天有分散小雨。粤北大部市县最低气温7℃～10℃，高寒山区3℃～5℃，茂名、湛江13～17℃，其余市县11℃～15℃。</p><p><br/></p><p>　　</p><p>15日，粤北市县阴天转多云，其余市县阴天有分散小雨，气温维持在较低水平。</p><p><br/></p><p>　　</p><p><strong>关注和建议：</strong></p><p><br/></p><p>　　</p><p>1.雨雾时能见度较差，请注意交通安全。</p><p><br/></p><p>　　</p><p>　　2.气温趋于寒冷，请注意防寒保暖。</p><p><br/></p><p>(广东天气)</p><p><br/></p>', '2017-01-10 05:13:15', NULL, '@作者', 100, 0, 20),
	(32, '测试公告测试公告', '<p><span style="color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Helvetica Neue&quot;, Helvetica, tahoma, arial, &quot;WenQuanYi Micro Hei&quot;, Verdana, sans-serif, 宋体; font-size: 12px; line-height: 20px; text-align: center; background-color: rgb(245, 245, 245);">测试公告</span></p>', '2017-01-12 17:25:30', NULL, '测试公告', 1, 0, 16),
	(33, '新的公告', '<p class="text" style="margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &quot;Hiragino Sans GB&quot;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);">2016年，万达院线仍然在大举扩张。在这一年里，万达院线连续收购了19家影院，总开业影院376家；新增银幕762块，达3319块。在保持高速扩张的基础上，万达院线还实现了单张银幕产出超过220万元。</p><p class="image" style="margin-top: 0px; margin-bottom: 20px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: arial, &quot;Hiragino Sans GB&quot;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-align: center; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);"><img src="http://h.hiphotos.baidu.com/news/w%3D638/sign=2effa2dbd9a20cf44690fddc4e084b0c/cf1b9d16fdfaaf5184a3a4e3855494eef01f7a2d.jpg" style="margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased; display: inline-block; max-width: 680px;"/></p><p class="text" style="margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &quot;Hiragino Sans GB&quot;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);">院线和银幕数量的增长不仅带来了大量顾客，还为万达院线在渠道上带来了更高的话语权。年前，冯小刚与万达之争将影视公司与院线的矛盾公之于众。在这条产业里，主动权已经由影视制作公司转向了院线，根据协议，影片上映时，院线即使没有参与制作发行，也有权从票房中获得分成。所以，对于已经成为全球规模最大的万达院线来说，其在渠道上的话语权越来越大，中国电影市场的增长，就意味着公司营业额的稳定增长。</p><p class="text" style="margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &quot;Hiragino Sans GB&quot;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);">除此以外，从经营简报中可以看到，增速最快的为非票房收入，达38亿元，占营收34%，同比增长101%，已成为公司经营的重要分支。据了解，非票房收入主要指电影衍生品、餐饮等卖品收入。事实上，在2013年的时候，万达院线的卖品收入就已经位居全国榜首。由此观之，万达院线营业额的增长，除了影院、银幕等硬实力的贡献，服务内容等软实力也不可小觑。</p><p class="text" style="margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &quot;Hiragino Sans GB&quot;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: 800; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased;">「长城」使股价下跌13%</span></p><p><br/></p>', '2017-01-12 19:09:54', '2017-01-12 19:11:17', '新的公告', 1, 0, 14),
	(27, '所配中国地图缺少台湾、南海诸岛等地，阿里巴巴致歉', '<p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">原标题：阿里官方微博致歉“问题地图”：我们犯了一个低级错误</p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">今日，阿里巴巴官方推特在马云和特朗普会面后发表了一条官方推特以此说明中美小企业和消费者之间的贸易机会。细心的网友发现该推特配图中的中国地图并不是标准的中国地图，缺少了台湾岛及附属岛屿、南海诸岛等部分版图，这一失误迅速引起了舆论关注。此后，阿里巴巴官方微博、推特同步发表声明致歉，并更新了相关配图。</p><p class="detailPic" style="margin: 0px auto 10px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: center; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><img src="http://p2.ifengimg.com/fck/2017_02/51064b4318a729b_w430_h600.jpg" title="此前阿里巴巴推文中的“问题地图”与更新后的地图对比" alt="此前阿里巴巴推文中的“问题地图”与更新后的地图对比" style="border: 0px; vertical-align: top; display: block; margin: 0px auto; max-width: 100%; height: 600px; padding: 0px; width: 430px;" vspace="0" border="0"/></p><p class="picIntro" style="margin: 0px 0px 25px; padding: 0px; text-indent: 0px; font-size: 14px; text-align: center; word-wrap: break-word; word-break: normal; font-family: 楷体_gb2312, 楷体; color: rgb(43, 43, 43); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="font-family: 楷体_gb2312, 楷体; font-size: 14px;">此前阿里巴巴推文中的“问题地图”与更新后的地图对比</span></p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">阿里巴巴官方微博称：对不起，我们犯了一个低级错误。在马云和美国当选总统会面之后，我们发布了一张图片，想说明中美小企业和消费者之间的贸易机会和前景。但这张图我们不仅漏掉了美国的夏威夷和阿拉斯加，也漏掉了我们国家的宝岛台湾。对这个错误我们不做任何辩解，只能立即修正， 并在此向大家深深致歉。</p><p class="detailPic" style="margin: 0px auto 10px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: center; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><img src="http://p2.ifengimg.com/fck/2017_02/4c8b4559f2fcec8_w344_h600.jpg" title="阿里巴巴官方微博发表声明致歉" alt="阿里巴巴官方微博发表声明致歉" style="border: 0px; vertical-align: top; display: block; margin: 0px auto; max-width: 100%; height: 600px; padding: 0px; width: 344px;" vspace="0" border="0"/></p><p class="picIntro" style="margin: 0px 0px 25px; padding: 0px; text-indent: 0px; font-size: 14px; text-align: center; word-wrap: break-word; word-break: normal; font-family: 楷体_gb2312, 楷体; color: rgb(43, 43, 43); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="font-family: 楷体_gb2312, 楷体; font-size: 14px;">阿里巴巴官方微博发表声明致歉</span></p><p style="margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">与此同时，阿里巴巴官方推特也同步更新了配图。</p><p class="detailPic" style="margin: 0px auto 10px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: center; overflow-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun,arial,helvetica,clean,sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><img src="http://p2.ifengimg.com/fck/2017_02/17b98b89561ef98_w337_h600.jpg" title="阿里巴巴推特上的相关推文已经更正了配图" alt="阿里巴巴推特上的相关推文已经更正了配图" style="border: 0px; vertical-align: top; display: block; margin: 0px auto; max-width: 100%; height: 600px; padding: 0px; width: 337px;" vspace="0" border="0"/></p>', '2017-01-10 07:04:04', NULL, 'ss', 100, 0, 13),
